import React from "react";
import Button from "./Button";

const Nav = () => {
    
    return(
        <div className="w-full h-16 bg-black">
        <h3 className="text-white text-xl px-10 pt-10">fintelogy</h3>
        <ul className="flex justify-center px-4">
            <li>Home</li>
            <li>Articles</li>
            <li>Events</li>
            <li>About</li>
        </ul>
        </div>
    )
}

export default Nav;
